import styles from './SignUp.module.css'
import TextBox from '../TextBox/TextBox'
import { useNavigate } from 'react-router-dom';
import { useFormik } from 'formik';
import { useDispatch } from 'react';
import signUpSchema from '../Schemas/SignUpSchema';
import { useState } from 'react';
function SignUp()
{
    const navigate = useNavigate();
    const dispatch = useDispatch();
    const [error, setError] = useState("");

    

    const HandleLogin = () => {
        navigate('/');
    }


    const {values, touched, handleBlur, handleChange, errors} = useFormik({
        initialValues: {
            name:"",
            phoneNumber:"",
            address:"",
            email:"",
            password:"",

        },
        validationSchema: signUpSchema 
    })




    return(
        <div className={styles.mainPage}>
        <div className={styles.pageHeader}>
            Welcome to <span className={styles.logo}>CoinBounce</span>
        </div>
        <TextBox type="text" placeholder="Enter your Name" name="name" value={values.name} onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <TextBox type="password" placeholder="Enter your Phone Number" name="phoneNumber" value={values.phoneNumber} onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <TextBox type="password" placeholder="Enter your Address" name="address" value={values.address} onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <TextBox type="text" placeholder="Enter your Email" value={values.email} name="email" onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <TextBox type="password" placeholder="Enter your Password" value={values.password} name="password" onChange={handleChange} onBlur={handleBlur} errormessage={errors.name} error={errors.name && touched.name ? 1 : undefined} />
        <button onClick={HandleLogin} className={styles.LoginButton}>
            Create Account
        </button>
        </div>
    )
}

export default SignUp
